-no-rj","width":250,"height":250},{"url":"https://yt3.ggpht.com/ytc/AKedOLR66nQtPFSM_-hHyg37qHUtDWMuAPtbgoF6n1WTMA=s400-c-k-c0x00ffffff-no-rj","width":400,"height":400}]},"icon":{"thumbnails":[{"url":"https://www.gstatic.com/youtube/img/annotations/youtube.png"}]},"left":0.022807017,"width":0.15438597,"top":0.13142523,"aspectRatio":1,"startMs":"33665066","endMs":"33684966","title":{"accessibility":{"accessibilityData":{"label":"Canal Bluuweb"}},"simpleText":"Bluuweb"},"metadata":{"simpleText":"Bienvenido al canal de cursos de desarrollo web y programación!\nSoy Ignacio Gutiérrez y de una forma divertida seré tu instructor.\n\nSiempre he dicho que la práctica hace al maestro, la programación no es más que repetición y repetición, por lo tanto para comenzar solo tienes que atreverte a escribir tus primeras líneas de código, así perderás el miedo y cada vez será más y más sencillo adquirir la lógica de programación.\n\nSi tu idea es ser un programador web, te recomiendo seguir los siguientes consejos:\n\nPerseverancia: Trata de practicar todos los días y aunque no te resulte a la primera, volver a intentar. Nadie nace aprendiendo por lo tanto todos pasamos por el mismo proceso.\nPaciencia: Puede que al principio te agobie la idea de que no estás avanzando o peor aún que son demasiadas cosas por aprender y que jamás vamos a terminar. Pero tranquilo, el primer paso es escribir tu primer hola mundo... de ahí al infinito.\nSonríe y disfruta :)"},"callToAction":{"simpleText":"VISITAR EL CANAL"},"dismiss":{"simpleText":"CANCELAR"},"endpoint":{"clickTrackingParams":"CCkQ-N4BGAAiEwi-uP2wwsn3AhUi3JQJHSOYDygyDGl2LWVuZHNjcmVlbkj2tNDq5Zqz-8MB","commandMetadata":{"webCommandMetadata":{"url":"/channel/UCH7IANkyEcsVW_y1IlpkamQ","webPageType":"WEB_PAGE_TYPE_CHANNEL","rootVe":3611,"apiUrl":"/youtubei/v1/browse"}},"browseEndpoint":{"browseId":"UCH7IANkyEcsVW_y1IlpkamQ"}},"hovercardButton":{"subscribeButtonRenderer":{"buttonText":{"runs":[{"text":"SUSCRITO"}]},"subscribed":true,"enabled"
